  selector:"app-gamepage",
  templateUrl:'GamePageComponent.component.html',
  styleUrls: ['./GamePageComponent.component.scss']
})
export class GamePageComponent implements OnInit {
  constructor() {}
    ngOnInit(): void {}
  }
<h1><div class="rectangle">{{"page"}}</div></h1>


